import {Box, ThemeProvider, Typography} from "@mui/material";
import introImg from "./asset/intro-image.jpeg";
import themeForProject from "../../../themeForProject";
export default function ProjectIterativeDesign() {
    const sketches = importAll(require.context('./images', false, /\.(png|jpe?g|svg)$/));

    return (
        <ThemeProvider theme={themeForProject}>
            <Box sx={{
                display: "flex",
                flexDirection: "column",
                alignItems: "center"
            }}>
                <Box component={"img"} src={introImg}
                     alt={"an image for the project: iterative design of Winno"}
                     sx={{
                         maxWidth: {
                             xs: "90%",
                             sm: "80%",
                             md: 600,
                             lg: 800
                         },
                         marginBottom: {
                             xs: 2,
                             sm: 5
                         }
                     }}/>
                <Box sx={{
                    maxWidth: {
                        xs: "90%",
                        sm: "80%",
                        md: 800,
                        lg: 1000
                    },
                    height: 500,
                    // textAlign: "left"
                }}>
                    <Typography variant={"h1"}>
                        Iterative Design: Winno
                    </Typography>
                    <Typography variant={"subtitle1"}>
                        Collaborators: XXXX, XXXX, XXXX
                    </Typography>

                    <Typography variant={"h2"}>
                        I. Sketching & Wireframing
                    </Typography>
                    <Typography variant={"h3"}>
                        Pre-Design Thinking: Introducing The Interface
                    </Typography>
                    <Typography variant={"body1"}>
                        For this project, our team decided to work on Winno, a mobile app designed to allow users to connect with experts to answer pressing questions with insight into different industries. Through this application, we address 2 key needs. First, users who want to learn want to connect with experts in different fields to answer pressing questions. Second, experts and creators want to own their audience and get paid directly by their top fans. Winno does just that. It allows users to discover experts and to schedule text sessions, and experts get paid for helping out and doing what they love.
                    </Typography>

                    <Typography variant={"h3"}>
                        Initial Sketches
                    </Typography>

                    <Box sx={{}}>

                    </Box>



                </Box>
            </Box>
        </ThemeProvider>
    )
}
